import "./Product.css"

function Product() {
  return (
    <div className='product'>
      <div class="product_info">
        <p className='product_title'>Title</p>
        <p className='product_price'><small>$</small><strong>9.99</strong></p>
      </div>
    </div>
  )
}

export default Product
